     *
     * #### Message status
     *
     * | **Status** | **Description** |
     * | --- | --- |
     * | `sent` | Message successfully dispatched to Braze’s email sending partner |
     * | `processed` | Email sending partner has successfully received and prepared the message for sending to the user’s inbox provider |
